import React from 'react';

const VideoItem = ({video}) => {
    return (
        <div className="item">
            <h6>{video.snippet.title}</h6>
            <img src={video.snippet.thumbnails.medium.url} alt={video.snippet.title} className="large " />
        </div>
    )
}

export default VideoItem;
